    constructor() {
        super()
        this.clickMore = this.clickMore.bind(this);
    }

    memberMore = []

    clickMore() {
        this.setState(function(prevIndex) {
        let newArray = this.memberMore.push( memberInfo[0] )
        })
    }

    render() {
        return(
            <button className="container bg-black text-white rounded" onClick={this.clickMore}>
                More Of Our Team
            </button>
        )
    }
}

